import React from 'react';
import classes from './Society.module.css';

function Society() {
  return (
    <section className={classes.society}>
      <h2>Society</h2>
      <p>Subhadra Mandal I 'Paradeep, Odisha'</p>
      <p>What would a 19-year-old choose between her family and dozens of unaffordable books?" asks the 24-year-old Subhadra Mandal.</p>
    </section>
  );
}

export default Society;
